INSERT INTO `cours` (`id`, `trace_ecrite`, `contenu`, `etat`, `statut`, `ue_id`, `enseignant_id`, `created_at`, `updated_at`) VALUES
(4, '<p style=\"text-align: center;\"><strong>indicateur de competance</strong></p>\r\n<p style=\"text-align: justify;\">A la fin de cette lecon, l\'leve doit etre capabe de:</p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>Lister les &Eacute;l&eacute;ments constitutifs de l&rsquo;unit&eacute; centrale</strong></li>\r\n<li style=\"text-align: left;\"><strong>dessiner le Sch&eacute;ma fonctionnel de l&rsquo;ordinateur</strong>\r\n<h2 style=\"text-align: center;\"><strong>I) les composants de la carte m&egrave;re</strong></h2>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">L&rsquo;unit&eacute; centrale est la partie essentielle de l&rsquo;ordinateur, &nbsp; &nbsp;c&rsquo;est &nbsp;un boitier &nbsp;constitu&eacute; d&rsquo;un ensemble de composants<br />fix&eacute;s sur un socle int&eacute;rieur appel&eacute; carte m&egrave;re</p>\r\n<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\" width=\"604\" height=\"246\" /></p>\r\n<ul>\r\n<li>La principale fonction d&rsquo;une carte m&egrave;re est la mise en relation des diff&eacute;rents composants fix&eacute;s</li>\r\n<li>le processeur qui effectue toutes les op&eacute;rations, il est le cerveau de l&rsquo;ordinateur</li>\r\n<li>les m&eacute;moires (disque dur, RAM, ROM) qui permettent de stocker les informations dont il a besoin pour effectuer les traitements&nbsp; demand&eacute;s, ainsi que les r&eacute;sultats de ces traitements...</li>\r\n</ul>\r\n<h2 style=\"text-align: center;\">II) SCHEMA FONCTIONNEL DE L&rsquo;ORDINATEUR</h2>\r\n<p>L&rsquo;ordinateur fonctionne selon le principe Entr&eacute;e &ndash; Traitement &ndash; Sortie.</p>\r\n<p>En effet, une information entre dans&nbsp;<br />l\'unit&eacute; centrale par un p&eacute;riph&eacute;rique d&rsquo;entr&eacute;e, puis elle est trait&eacute;e par le processeur et &nbsp;ressort vers l\'utilisateur &agrave; travers un p&eacute;riph&eacute;rique de Sortie. Elle se resume par l\'image</p>\r\n<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" alt=\"\" width=\"847\" height=\"199\" /></p>\r\n<p>&nbsp;</p>', NULL, 0, 'non valide', 4, 1, '2021-06-29 11:22:12', '2021-06-29 15:29:11');
